 * @return {number}
 */
var incremovableSubarrayCount = function(nums) {
    let count = 0;

    // Iterate over all subarrays
    for (let start = 0; start < nums.length; start++) {
        for (let end = start; end < nums.length; end++) {
            // Check if the subarray [start, end] is incremovable
            if (containsNonIncreasingPair(nums, start, end)) {
                count++;
            }
        }
    }

    return count;
};

/**
 * Check if the subarray contains at least one pair of elements where 
 * the left element is not less than the right element.
 * @param {number[]} nums - The array of numbers.
 * @param {number} start - The starting index of the subarray.
 * @param {number} end - The ending index of the subarray.
 * @return {boolean} - True if the subarray is incremovable, else false.
 */
function containsNonIncreasingPair(nums, start, end) {
    for (let i = start; i < end; i++) {
        if (nums[i] >= nums[i + 1]) {
            return true;
        }
    }
    return false;
}
